import React, {Component} from 'react';
import Law from './Law.js';

class Laws extends Component {
    
    render(){
        return(
            <Law law={this.state.laws} />
        );
    }

    state = {
        laws: []
    };

    componentDidMount() {
        fetch('http://data.finlex.fi/eli/sd/2016/20161126')
            .then(res => res.json())
            .then((data) => {
                this.setState({ laws: data })
            })
            .catch(console.log)
    }
}

export default Laws;
